import{_ as e,c as o,o as d,a1 as c}from"./chunks/framework.BdbYcYPl.js";const b=JSON.parse('{"title":"各品牌型号命名规则（或规律）","description":"","frontmatter":{},"headers":[],"relativePath":"数码/name-rule.md","filePath":"数码/name-rule.md"}'),a={name:"数码/name-rule.md"},l=c('<h1 id="各品牌型号命名规则-或规律" tabindex="-1">各品牌型号命名规则（或规律） <a class="header-anchor" href="#各品牌型号命名规则-或规律" aria-label="Permalink to &quot;各品牌型号命名规则（或规律）&quot;">​</a></h1><h2 id="_360-手机" tabindex="-1">360 手机 <a class="header-anchor" href="#_360-手机" aria-label="Permalink to &quot;360 手机&quot;">​</a></h2><h3 id="型号命名规则" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>四位数字</code> + <code>一位字母</code> + <code>二位数字</code></p><ul><li><code>四位数字</code>: 区分产品，前二位代表年份，后二位无明显规律</li><li><code>一位字母</code>: 区分渠道版本，<code>A</code> - 全网通公开版；<code>M</code> - 移动定制版</li><li><code>二位数字</code>: 区分 SKU</li><li><strong>示例:</strong> <code>1503-A01</code>（360 手机 N4 全网通版），其中 <code>15</code> 代表 2015 年，该产品为 2015 年立项；<code>A</code> 代表全网通公开版</li></ul><h2 id="apple-苹果" tabindex="-1">Apple (苹果) <a class="header-anchor" href="#apple-苹果" aria-label="Permalink to &quot;Apple (苹果)&quot;">​</a></h2><h3 id="型号命名规则-1" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-1" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>A</code> + <code>四位数字</code></p><ul><li><code>四位数字</code>: 无明显规律，但通常数字越大推出时间越晚，例如 <code>A2XXX</code> 通常晚于 <code>A1XXX</code>（可能有反例）</li></ul><h2 id="华为-huawei" tabindex="-1">华为 (HUAWEI) <a class="header-anchor" href="#华为-huawei" aria-label="Permalink to &quot;华为 (HUAWEI)&quot;">​</a></h2><h3 id="型号命名规则-2" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-2" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>XXX-</code> + <code>一位或二位字母</code> + <code>二位数字</code> (+ <code>一位字母</code>)</p><ul><li><code>XXX</code>: 区分产品，为产品研发代号缩写，通常为二至四位字母</li><li><code>一位或二位字母</code>: 区分渠道或网络版本，<code>T</code> - 移动 3G 版；<code>U</code> - 联通 3G 版；<code>C</code> - 电信 3G 版；<code>TL</code> - 移动 4G 版；<code>UL</code> 或 <code>DL</code> - 联通 4G 版/双 4G 公开版；<code>CL</code> - 电信 4G 版；<code>AL</code> - 全网通 4G 公开版；<code>AN</code> - 全网通 5G 版；<code>TN</code> - 移动 5G 定制版；<code>W</code> - Wi-Fi 版（平板电脑/笔记本电脑）；<code>L</code> - 海外 4G 版或早期国行 4G 版；<code>N</code> - 海外 5G 版；<code>B</code> - 蓝牙版（穿戴设备）</li><li><code>二位数字</code>: 区分 SKU，海外型号可能包含字母</li><li><code>一位字母</code>: 区分 SKU 或渠道，视具体产品而定</li><li><strong>示例:</strong> <code>NOH-AN00</code>（HUAWEI Mate 40 Pro 5G 全网通版），其中 <code>NOH</code> 为产品代号 <code>noah</code> 缩写；<code>AN</code> 代表全网通 5G 版</li><li><strong>注:</strong> 2023 年后推出的华为 5G 产品仍沿用 4G 制式的型号命名</li></ul><h3 id="传播名注意事项" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><p>华为大部分产品传播名中的品牌名称均为六个大写字母「HUAWEI」，指代华为公司时可以写作「Huawei」（首字母大写）</p><h2 id="荣耀-honor" tabindex="-1">荣耀 (HONOR) <a class="header-anchor" href="#荣耀-honor" aria-label="Permalink to &quot;荣耀 (HONOR)&quot;">​</a></h2><h3 id="型号命名规则-3" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-3" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p>同华为</p><ul><li><strong>示例:</strong> <code>NTH-AN00</code>（荣耀 50 5G 全网通版），其中 <code>NTH</code> 为产品代号 <code>nottingham</code> 缩写；<code>AN</code> 代表全网通 5G 版</li></ul><h3 id="传播名注意事项-1" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项-1" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><p>荣耀 Magic/Play 系列，系列名与数字之间无空格</p><h2 id="魅族-meizu" tabindex="-1">魅族 (MEIZU) <a class="header-anchor" href="#魅族-meizu" aria-label="Permalink to &quot;魅族 (MEIZU)&quot;">​</a></h2><h3 id="型号命名规则-4" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-4" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>一位字母</code> + <code>三位数字</code> + <code>一位字母</code></p><ul><li><code>一位字母</code>: <code>M</code> 最为常见，此外还有 <code>Y</code> <code>U</code> <code>S</code> <code>L</code></li><li><code>三位数字</code>: 区分产品，第一位为年份末位，如 <code>9</code> 代表 2019 年；第二位通常数字越大定位越高；第三位通常数字越大推出时间越晚</li><li><code>一位字母</code>: 区分渠道或网络版本，<code>Q</code> - 全网通公开版；<code>M</code> 或 <code>Y</code> - 移动版；<code>U</code> - 联通版；<code>C</code> 或 <code>D</code> - 电信版；<code>A</code> - YunOS 版；<code>H</code> - 海外版；空缺代表双网通公开版</li><li><strong>示例:</strong> <code>M971Q</code>（魅族 16s 全网通公开版），其中 <code>9</code> 代表 2019 年产品；<code>Q</code> 代表全网通公开版</li></ul><h3 id="传播名注意事项-2" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项-2" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><p>魅族/魅蓝 Note 系列，系列名与数字之间无空格</p><h2 id="摩托罗拉-motorola" tabindex="-1">摩托罗拉 (Motorola) <a class="header-anchor" href="#摩托罗拉-motorola" aria-label="Permalink to &quot;摩托罗拉 (Motorola)&quot;">​</a></h2><h3 id="型号命名规则-5" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-5" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>XT</code> + <code>四位数字</code> + 横杠 + <code>一位或二位数字</code></p><ul><li><code>四位数字</code>: 区分产品，前二位代表年份，后二位无明显规律</li><li><code>一位或二位数字</code>: 区分网络或地区版本，无明显规律</li><li><strong>示例:</strong> <code>XT2201-2</code>（moto edge X30），其中 <code>22</code> 代表 2022 年（但实际于 2021 年年底上市）</li></ul><h3 id="传播名注意事项-3" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项-3" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><p>摩托罗拉近几年产品的传播名中的品牌名称为全小写「moto」或「motorola」</p><h2 id="诺基亚-nokia-hmd" tabindex="-1">诺基亚 (Nokia，HMD) <a class="header-anchor" href="#诺基亚-nokia-hmd" aria-label="Permalink to &quot;诺基亚 (Nokia，HMD)&quot;">​</a></h2><h3 id="型号命名规则-6" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-6" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>TA-</code> + <code>四位数字</code></p><ul><li><code>四位数字</code>: 区分产品，无明显规律，但通常数字越大推出时间越晚</li></ul><h2 id="努比亚-nubia" tabindex="-1">努比亚 (nubia) <a class="header-anchor" href="#努比亚-nubia" aria-label="Permalink to &quot;努比亚 (nubia)&quot;">​</a></h2><h3 id="型号命名规则-7" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-7" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>NX</code> + <code>三位数字</code> + <code>一位字母</code></p><ul><li><code>三位数字</code>: 区分产品，无明显规律</li><li><code>一位字母</code>: <code>J</code> 最为常见，代表全网通版，此外还有 <code>H</code>，代表双网通版或高配版；个别产品有横杠加后缀，代表衍生版本，例如 <code>NX669J-S</code></li></ul><h2 id="一加-oneplus" tabindex="-1">一加 (OnePlus) <a class="header-anchor" href="#一加-oneplus" aria-label="Permalink to &quot;一加 (OnePlus)&quot;">​</a></h2><h3 id="型号命名规则-2019-2022" tabindex="-1">型号命名规则（2019-2022） <a class="header-anchor" href="#型号命名规则-2019-2022" aria-label="Permalink to &quot;型号命名规则（2019-2022）&quot;">​</a></h3><p><code>二位字母</code> + <code>四位数字</code></p><ul><li><code>二位字母</code>: 区分产品系列，为产品研发代号缩写</li><li><code>四位数字</code>: 区分 SKU，前二位代表年份；第三位数字越大，在系列内定位越高；第四位用于区分地区/运营商版本，<code>0</code> - 国行，<code>1</code> - 印度版，<code>3</code> - 欧版，<code>5</code> - 北美版/全球版，<code>7</code> - T-Mobile 版，<code>9</code> - Verizon 版（个别产品可能有出入）</li><li><strong>示例:</strong> <code>LE2120</code>（OnePlus 9 Pro 国行全网通版），其中 <code>LE</code> 为系列产品代号 <code>lemonade</code> 缩写；<code>21</code> 代表 2021 年，第四位 <code>0</code> 代表国行全网通版</li></ul><h3 id="型号命名规则-2022" tabindex="-1">型号命名规则（2022-） <a class="header-anchor" href="#型号命名规则-2022" aria-label="Permalink to &quot;型号命名规则（2022-）&quot;">​</a></h3><p>同 OPPO（包括国行和海外型号）</p><ul><li><strong>示例:</strong> <code>PGKM10</code>（一加 Ace），其中 <code>M</code> 代表全网通版</li></ul><h3 id="传播名注意事项-4" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项-4" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><p>产品传播名中，品牌名无论叫「一加」还是叫「OnePlus」都没有问题，但在重新并入 OPPO 之前，官方宣发中品牌名为「OnePlus」，其中字母 O、P 为大写</p><h2 id="oppo" tabindex="-1">OPPO <a class="header-anchor" href="#oppo" aria-label="Permalink to &quot;OPPO&quot;">​</a></h2><h3 id="型号命名规则-国行-2018-年起" tabindex="-1">型号命名规则（国行，2018 年起） <a class="header-anchor" href="#型号命名规则-国行-2018-年起" aria-label="Permalink to &quot;型号命名规则（国行，2018 年起）&quot;">​</a></h3><p><code>P</code> + <code>二位字母</code> + <code>M</code> 或 <code>T</code> 或 <code>1</code> + <code>二位数字</code></p><ul><li><code>二位字母</code>: 区分产品，无明显规律，但通常第一位字母顺序越靠后，推出时间越晚</li><li><code>M</code> <code>1</code> 代表全网通版，<code>T</code> 代表移动定制版</li><li><code>二位数字</code>: 无意义，有时也区分产品</li><li><strong>示例:</strong> <code>PFDM00</code>（OPPO Reno7 Pro 全网通版），其中 <code>M</code> 代表全网通版</li></ul><h3 id="型号命名规则-平板电脑" tabindex="-1">型号命名规则（平板电脑） <a class="header-anchor" href="#型号命名规则-平板电脑" aria-label="Permalink to &quot;型号命名规则（平板电脑）&quot;">​</a></h3><p><code>OPD</code> + <code>四位数字</code></p><ul><li><code>四位数字</code>: 区分产品，无明显规律</li></ul><h3 id="型号命名规则-手表-手环" tabindex="-1">型号命名规则（手表/手环） <a class="header-anchor" href="#型号命名规则-手表-手环" aria-label="Permalink to &quot;型号命名规则（手表/手环）&quot;">​</a></h3><p><code>O</code> + <code>一位字母</code> + <code>年份</code> + <code>一位字母</code> + <code>一位数字</code></p><ul><li><code>一位字母</code>: 区分系列，<code>W</code> 为全智能手表 (eSIM)，<code>R</code> 为轻智能手表，<code>B</code> 为手环；后面的字母通常与前面相同，但个别产品有例外（如 OPPO 手环 出现过 <code>OB19O1</code> 的型号）</li><li><code>一位数字</code>: 区分产品，全智能手表中，通常 <code>1</code> 代表 46mm 版，<code>2</code> 代表 42mm 版，<code>3</code> 代表 ECG 版，国外版可能为 <code>6</code>、<code>8</code>、<code>12</code> 等；其余通常为 <code>1</code></li><li><strong>示例:</strong> <code>OW20W3</code>（OPPO Watch 2 eSIM ECG），其中<code>W</code> 为全智能手表 (eSIM) 系列，<code>20</code> 代表 2020 年立项（但实际于 2021 年上市），<code>3</code> 代表 ECG 版</li></ul><p><code>OWW</code> + <code>年份</code> + <code>一位数字</code></p><ul><li><code>一位数字</code>: 区分产品/系列</li><li><strong>示例:</strong> <code>OWW202</code>（OPPO Watch 2 蓝牙版 42mm），<code>20</code> 代表 2020 年立项（但实际于 2021 年上市），<code>2</code> 代表这一产品</li><li><strong>示例:</strong> <code>OWW208</code>（OPPO Watch Free），<code>20</code> 代表 2020 年立项（但实际于 2021 年上市），<code>8</code> 代表这一产品</li></ul><h3 id="型号命名规则-海外" tabindex="-1">型号命名规则（海外） <a class="header-anchor" href="#型号命名规则-海外" aria-label="Permalink to &quot;型号命名规则（海外）&quot;">​</a></h3><p><code>CPH</code> + <code>四位数字</code></p><ul><li><code>四位数字</code>: 区分产品，无明显规律，但通常前二位数字越大，产品推出时间越晚</li></ul><h3 id="传播名注意事项-5" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项-5" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><p>「OPPO」四个字母均为大写；Reno/OPPO Ace 系列，系列名与数字之间无空格</p><h2 id="realme-真我" tabindex="-1">realme (真我) <a class="header-anchor" href="#realme-真我" aria-label="Permalink to &quot;realme (真我)&quot;">​</a></h2><h3 id="型号命名规则-8" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-8" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>RMX</code> 或 <code>RMP</code> 或 <code>RMW</code> + <code>四位数字</code></p><ul><li><code>RMX</code> 为 realme 手机，<code>RMP</code> 为平板，<code>RMW</code> 为手表</li><li><code>四位数字</code>: 区分产品，无明显规律，但通常前二位数字越大，产品推出时间越晚</li></ul><h3 id="传播名注意事项-6" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项-6" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><p>「realme」首字母为小写；产品传播名「真我 XXX」「realme XXX」「realme 真我 XXX」都没有问题，中国大陆地区官方宣发通常采用三者中第一个</p><h2 id="三星-samsung" tabindex="-1">三星 (Samsung) <a class="header-anchor" href="#三星-samsung" aria-label="Permalink to &quot;三星 (Samsung)&quot;">​</a></h2><h3 id="型号命名规则-9" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-9" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>SM-</code> + <code>一位字母</code> + <code>三位数字</code> + <code>一位或二位字符</code></p><ul><li><code>一位字母</code>: 区分系列，<code>S</code> - Galaxy S (S22 之后)，<code>G</code> - Galaxy S (S5-S21)，<code>N</code> - Galaxy Note，<code>F</code> - Galaxy Z，<code>A</code> - Galaxy A，<code>M</code> - Galaxy M，<code>E</code> 或 <code>F</code> - Galaxy F，<code>C</code> - Galaxy C，<code>J</code> - Galaxy J，<code>T</code> <code>X</code> - Galaxy Tab，<code>R</code> - Galaxy Watch</li><li><code>三位数字</code>: 区分定位，第一位越大在全产品线的定位越高，第二位通常表示代数，第三位表示这一代同系列的定位</li><li><code>一位或二位字符</code>: 区分地区版本，<code>0</code> - 国行公开版，<code>8</code> - 移动定制版，<code>9</code> - 电信定制版，<code>B</code> <code>E</code> - 国际版 (5G)，<code>F</code> <code>G</code> - 国际版 (4G)，<code>H</code> - 国际版 (3G)，<code>U</code> - 美版有锁，<code>U1</code> - 美版无锁，<code>V</code> - Verizon，<code>A</code>- AT&amp;T，<code>T</code> - T-Mobile，<code>P</code> - Sprint，<code>N</code> - 韩版，<code>W</code> - 加拿大版，<code>Q</code> - 日版无锁，<code>M</code> - 拉美版，<code>C</code> - 国行平板蜂窝网络版</li><li><strong>示例:</strong> <code>SM-S9280</code>（Galaxy S24 Ultra 国行版），其中 <code>S</code> 代表 Galaxy S 系列；<code>928</code> 中的 <code>2</code> 代表这一代，<code>8</code> 代表同系列中的 Ultra 机型；<code>0</code> 代表国行公开版</li></ul><h3 id="传播名注意事项-7" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项-7" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><ul><li>Galaxy Note/Z Fold/Z Flip/Watch 等系列，系列名与数字之间无空格</li></ul><h2 id="vivo" tabindex="-1">vivo <a class="header-anchor" href="#vivo" aria-label="Permalink to &quot;vivo&quot;">​</a></h2><h3 id="型号命名规则-2018-年起" tabindex="-1">型号命名规则（2018 年起） <a class="header-anchor" href="#型号命名规则-2018-年起" aria-label="Permalink to &quot;型号命名规则（2018 年起）&quot;">​</a></h3><p><code>V</code> 或 <code>I</code> + <code>四位数字</code> + <code>一位字母</code></p><ul><li><code>V</code> 代表 vivo，<code>I</code> 代表 iQOO（仅海外版）</li><li><code>四位数字</code>: 前二位代表年份，后二位用于区分产品；部分型号后跟一位字母，代表衍生版本</li><li><code>一位字母</code>: 区分渠道版本，<code>A</code> - 全网通版，<code>T</code> - 移动版，空缺代表海外版</li><li><strong>示例:</strong> <code>V2136A</code>（iQOO 8 全网通版），其中 <code>21</code> 代表 2021 年（个别产品可能有出入）；<code>A</code> 代表全网通版</li></ul><h3 id="型号命名规则-平板电脑-1" tabindex="-1">型号命名规则（平板电脑） <a class="header-anchor" href="#型号命名规则-平板电脑-1" aria-label="Permalink to &quot;型号命名规则（平板电脑）&quot;">​</a></h3><p><code>PA</code> + <code>四位数字</code></p><ul><li><code>四位数字</code>: 区分产品，无明显规律</li></ul><h3 id="传播名注意事项-8" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项-8" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><p>「vivo」四个字母均为小写；「iQOO」首字母小写，其他字母大写；iQOO Neo 系列，系列名与数字之间无空格</p><h2 id="小米-xiaomi" tabindex="-1">小米 (Xiaomi) <a class="header-anchor" href="#小米-xiaomi" aria-label="Permalink to &quot;小米 (Xiaomi)&quot;">​</a></h2><h3 id="型号命名规则-2018-2021" tabindex="-1">型号命名规则（2018-2021） <a class="header-anchor" href="#型号命名规则-2018-2021" aria-label="Permalink to &quot;型号命名规则（2018-2021）&quot;">​</a></h3><p><code>M</code> + <code>四位数字</code> + <code>XXX</code> + <code>一位字母</code></p><ul><li><code>四位数字</code>: 前二位代表年份，后二位代表月份，表示该产品开售（不是发布）时间不早于该日期</li><li><code>XXX</code>: 通常由一位字母、数字与后缀字母构成，为产品内部编号；数字与产品系列之间有规律关系</li><li><code>一位字母</code>: 区分渠道版本，<code>A</code> <code>E</code> - 国行全网通版，<code>C</code> - 国行全网通版（2020 及之后）或运营商定制版（2019 及之前），<code>G</code> <code>H</code> <code>Y</code> - 全球版，<code>I</code> <code>P</code> - 印度版，<code>L</code> - 拉丁美洲版，<code>R</code> - 日本版，<code>T</code> - 运营商定制版或泰国版, <code>W</code> - Wi-Fi 版（小米平板 4）</li><li><strong>示例:</strong> <code>M2102K1AC</code>（小米 11 Pro 全网通版），其中 <code>2102</code> 表示该产品开售时间不早于 2021 年 2 月；<code>K1A</code> 为产品内部编号；<code>C</code> 代表国行全网通版</li></ul><h3 id="型号命名规则-2021-2023" tabindex="-1">型号命名规则（2021-2023） <a class="header-anchor" href="#型号命名规则-2021-2023" aria-label="Permalink to &quot;型号命名规则（2021-2023）&quot;">​</a></h3><p><code>四位数字</code> + <code>XXX</code> + <code>一位字母</code></p><ul><li><code>四位数字</code>: 前二位代表年份，后二位代表月份，表示该产品开售（不是发布）时间不早于该日期</li><li><code>XXX</code>: 通常由几位数字及后缀字母构成，为产品内部编号；前一或二位数字代表第几个英文字母；剩余部分与产品系列之间有规律关系</li><li><code>一位字母</code>: 区分渠道版本，<code>C</code> - 国行全网通版，<code>G</code> <code>Y</code> - 全球版，<code>I</code> <code>P</code> - 印度版，<code>H</code> - 可能是全球版也可能是印度版，<code>L</code> - 拉丁美洲版，<code>R</code> - 日本版，<code>T</code> - 泰国版</li><li><strong>示例:</strong> <code>21091116C</code>（Redmi Note 11 Pro 全网通版），其中 <code>2109</code> 表示该产品开售时间不早于 2021 年 9 月；<code>1116</code> 表示产品内部编号为 <code>K16</code>（前二位代表第 11 个英文字母 K）；<code>C</code> 代表国行全网通版</li></ul><h3 id="型号命名规则-2022-1" tabindex="-1">型号命名规则（2022-） <a class="header-anchor" href="#型号命名规则-2022-1" aria-label="Permalink to &quot;型号命名规则（2022-）&quot;">​</a></h3><p><code>四位数字</code> + <code>五位识别码</code> + <code>一位字母</code></p><ul><li><code>四位数字</code>: 前二位代表年份，后二位代表月份，表示该产品开售（不是发布）时间不早于该日期</li><li><code>五位识别码</code>: 由字母和数字构成。第二、三位代表产品系列，<code>PN</code> - Xiaomi 数字/Civi，<code>PX</code> - Xiaomi MIX，<code>PY</code> - Xiaomi Civi，<code>RA</code> - Redmi Note，<code>RN</code> - Redmi 数字系列，<code>RK</code> - Redmi K 系列，<code>PC</code> - POCO，<code>RP</code> - 平板</li><li><code>一位字母</code>: 区分渠道版本，<code>C</code> - 国行全网通版，<code>A</code> <code>G</code> <code>O</code> <code>X</code> <code>Y</code> - 全球版，<code>I</code> <code>P</code> - 印度版，<code>H</code> - 可能是全球版也可能是印度版，<code>L</code> - 拉丁美洲版，<code>R</code> - 日本版，<code>T</code> - 泰国版</li><li><strong>示例:</strong> <code>22127RK46C</code>（Redmi K60 Pro 全网通版），其中 <code>2212</code> 表示该产品开售时间不早于 2022 年 12 月；<code>RK</code> 代表 Redmi K 系列；<code>C</code> 代表国行全网通版</li></ul><h3 id="传播名注意事项-9" tabindex="-1">传播名注意事项 <a class="header-anchor" href="#传播名注意事项-9" aria-label="Permalink to &quot;传播名注意事项&quot;">​</a></h3><p>2021 年 Q3 起，小米品牌产品传播名中的品牌名称为六个字母「Xiaomi」（X 大写，其他字母小写），例如 <code>Xiaomi MIX 4</code>，该变更是全球范围的；Redmi 品牌独立后，除数字系列与部分 IoT 产品外，官方宣发通常不使用「红米」二字</p><h2 id="黑鲨" tabindex="-1">黑鲨 <a class="header-anchor" href="#黑鲨" aria-label="Permalink to &quot;黑鲨&quot;">​</a></h2><h3 id="型号命名规则-10" tabindex="-1">型号命名规则 <a class="header-anchor" href="#型号命名规则-10" aria-label="Permalink to &quot;型号命名规则&quot;">​</a></h3><p><code>三位字母</code> + 横杠 + <code>A0</code> 或 <code>H0</code></p><ul><li><code>三位字母</code>: 区分产品，为产品研发代号缩写</li><li><code>A0</code> 代表国行全网通版，<code>H0</code> 代表全球版</li><li><strong>示例:</strong> <code>SHARK PRS-A0</code>（黑鲨 4/4S 全网通版），其中 <code>PRS</code> 为产品代号 <code>penrose</code> 缩写；<code>A0</code> 代表国行全网通版</li><li><strong>注:</strong> 黑鲨手机命名规则继承自酷派</li></ul>',104),i=[l];function r(t,h,n,u,s,m){return d(),o("div",null,i)}const q=e(a,[["render",r]]);export{b as __pageData,q as default};
